function LWGenPallete(){}function intervals(e){for(var t=[],r=0;steps>r;r++)t[r]=Math.round(e-e*strength/100/(steps-1)*r);return t}function intervalsR(e){for(var t=[],r=0;steps>r;r++)t[r]=Math.round(e+(255-e)*strength/100/(steps-1)*r);return t}function colorToInts(e){for(var t=[],r=0;3>r;r++)t[r]=toInt(e.substring(2*r,2*(r+1)));return t}function intsToColor(e){for(var t="",r=0;3>r;r++)t+=toHex(e[r],2);return t}function toInt(e){return parseInt(e,16)}function toHex(e,t){for(var r=e.toString(16);r.length<t;)r="0"+r;return r}var generatedColors=[],base=[255,255,255],steps=2,strength=100,pivot=0;LWGenPallete.prototype.setBase=function(e){return 6==e.length?(base=colorToInts(e),!0):!1},LWGenPallete.prototype.setBaseS=function(e){if(6==e.length){var t=0;base=colorToInts(e);for(var r=0;r<base.length;r++)base[r]>t&&(t=base[r],pivot=r);return!0}return!1},LWGenPallete.prototype.setSteps=function(e){return e>=2&&256>e?(steps=e,!0):!1},LWGenPallete.prototype.setStrength=function(e){return 100>=e&&e>=0?(strength=e,!0):!1},LWGenPallete.prototype.setPivot=function(e){return 2>=e&&e>=0?(pivot=e,!0):!1},LWGenPallete.prototype.getGenerated=function(){return generatedColors},LWGenPallete.prototype.getBase=function(){return base},LWGenPallete.prototype.getSteps=function(){return steps},LWGenPallete.prototype.getStrength=function(){return strength},LWGenPallete.prototype.getPivot=function(){return pivot},LWGenPallete.prototype.getPivotO=function(){for(var e,t=256,r=0;r<base.length;r++)base[r]<t&&(t=base[r],e=r);return e},LWGenPallete.prototype.toString=function(){for(var e,t="",r=0;r<generatedColors.length;r++)e=intsToColor(generatedColors[r]),t+=e+"\n";return t},LWGenPallete.prototype.clear=function(){generatedColors=[],base=[255,255,255],steps=2,strength=100,pivot=0},LWGenPallete.prototype.linear=function(){generatedColors=[];for(var e=intervals(base[pivot]),t=0;steps>t;t++)switch(pivot){case 0:generatedColors[t]=intsToColor([e[t],base[1],base[2]]);break;case 1:generatedColors[t]=intsToColor([base[0],e[t],base[2]]);break;case 2:generatedColors[t]=intsToColor([base[0],base[1],e[t]])}return toString()},LWGenPallete.prototype.linearR=function(){generatedColors=[];for(var e=intervalsR(base[pivot]),t=0;steps>t;t++)switch(pivot){case 0:generatedColors[t]=intsToColor([e[t],base[1],base[2]]);break;case 1:generatedColors[t]=intsToColor([base[0],e[t],base[2]]);break;case 2:generatedColors[t]=intsToColor([base[0],base[1],e[t]])}return toString()},LWGenPallete.prototype.distill=function(){generatedColors=[];var e=0,t=0;switch(pivot){case 0:e=1,t=2;break;case 1:e=0,t=2;break;case 2:e=0,t=1}for(var r=intervals(base[e]),o=intervals(base[t]),n=0;steps>n;n++)switch(pivot){case 0:generatedColors[n]=intsToColor([base[0],r[n],o[n]]);break;case 1:generatedColors[n]=intsToColor([r[n],base[1],o[n]]);break;case 2:generatedColors[n]=intsToColor([r[n],o[n],base[2]])}return toString()},LWGenPallete.prototype.distillR=function(){generatedColors=[];var e=0,t=0;switch(pivot){case 0:e=1,t=2;break;case 1:e=0,t=2;break;case 2:e=0,t=1}for(var r=intervalsR(base[e]),o=intervalsR(base[t]),n=0;steps>n;n++)switch(pivot){case 0:generatedColors[n]=intsToColor([base[0],r[n],o[n]]);break;case 1:generatedColors[n]=intsToColor([r[n],base[1],o[n]]);break;case 2:generatedColors[n]=intsToColor([r[n],o[n],base[2]])}return toString()},LWGenPallete.prototype.shade=function(){generatedColors=[];for(var e=intervals(base[0]),t=intervals(base[1]),r=intervals(base[2]),o=0;steps>o;o++)generatedColors[o]=intsToColor([e[o],t[o],r[o]]);return toString()},LWGenPallete.prototype.shadeR=function(){generatedColors=[];for(var e=intervalsR(base[0]),t=intervalsR(base[1]),r=intervalsR(base[2]),o=0;steps>o;o++)generatedColors[o]=intsToColor([e[o],t[o],r[o]]);return toString()};
